/*----------- Main ---------------*/
html {
  font-size: 62.5%;
  /* => default browser font-size =16px, decrease to a 10 base font for rem*/ }

body {
  font-size: 14px;
  font-size: 1.4rem;
  color: #555;
  font-family: "opensans", "Arial", sans-serif;
  line-height: 1.5;
  margin: 0;
  padding: 0; }

.container {
  max-width: 70rem;
  margin-left: auto;
  margin-right: auto;
  margin: 0 auto; }
  .container:after {
    content: " ";
    display: block;
    clear: both; }

.content {
  width: 74.6988%;
  float: left;
  margin-right: 1.20482%; }

.nav-toc {
  width: 24.09639%;
  float: right;
  margin-right: 0; }
  .nav-toc .h2 {
    font-size: 14px;
    font-size: 1.4rem; }
  .nav-toc .h3 {
    font-size: 12px;
    font-size: 1.2rem;
    margin-left: 10px;
    margin-left: 1rem; }
  .nav-toc ul {
    padding: 0;
    list-style: none; }

.box, .box_notice {
  background: #f0f0f0;
  margin: 0 0 20px;
  padding: 20px 20px 10px;
  box-shadow: #CCCCCC 0 1px 3px; }

.fixedsticky {
  top: 0;
  right: 0; }

.to-be-modified {
  background-color: #DDDDDD;
  color: #808080; }

